    false,nt"url": null,nt"notes": "This annual narrative report for Madison
    Wetland Management District outlines District accomplishments during the 1978 calendar
    year. The report begins by describing the climate and habitat conditions in the
    District, as well as the land acquisition program and system status. The construction
    and maintenance section describes physical developments and maintenance. The habitat
    management section discusses croplands, grasslands, wetlands, forestlands, and easements
    for waterfowl management. Wildlife- including endangered and threatened species,
    migratory birds, big game animals, and raptors- are discussed. The public relations
    sections describes information and recreation, recreational uses, and enforcement.
    Field investigations, cooperative programs, items of interest, and safety are discussed.
